            </Text>
            <TouchableOpacity>
                <Text
                style={{
                    width: 75,
                    height: 80,
                    paddingTop: 20,
                    marginRight: 20,
                    marginLeft: 20,
                    marginTop: 20,
                    borderWidth: 1,
                    textAlign: 'center',
                    alignContent: 'center',
                    borderColor: "#FF6767",
                    fontSize: 25,
                    
                }}>
                    1
                </Text>
            </TouchableOpacity>
        </View>
    );
}

export default Rating;
